NOBLENESS
No"ble*ness, n.

Defn: The quality or state of being noble; greatness; dignity;
magnanimity; elevation of mind, character, or station; nobility;
grandeur; stateliness.
His purposes are full honesty, nobleness, and integrity. Jer. Taylor.

OUTBOARD
Out"board`, a. & adv. (Naut.)

Defn: Beyond or outside of the lines of a vessel's bulwarks or hull;
in a direction from the hull or from the keel; -- opposed to inboard;
as, outboard rigging; swing the davits outboard.
